import { TaskListShellComponent } from './task-list-shell/task-list-shell.component';
import { TaskEditShellComponent } from './task-edit-shell/task-edit-shell.component';

const routes: Routes = [
  {
    path: '',
    redirectTo: 'task',
    pathMatch: 'full'
  },
